  const mapStyle={
    weight: 1,
    backgroundColor: "white",
  };

  return (
    <MapContainer center={[25.047807, 121.517529]} zoom={13} >

      <TileLayer
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        url="https://tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
      <GeoJSON style={mapStyle} data={mapdata} ></GeoJSON>
    </MapContainer>
  ); 
}

export default App;
